import React from "react";
import Header from "../components/Header";
import Projects from "../components/Projects";

function Portfolio() {
  return (
    <React.Fragment>
      <div className="background">
        <Header />
        <Projects />
      </div>
    </React.Fragment>
    );
}

export default Portfolio;
